import React from 'react';
import Navbar from './components/Navbar';
import './App.css';

function App() {
  return (
    <div className="App">
      <Navbar />
      <main className="main-content">
        <div className="container">
          <h1>Welcome to Onkar Yadav's Website</h1>
          <p>Simple and elegant design with smooth animations.</p>
        </div>
      </main>
    </div>
  );
}

export default App;
